import { createMuiTheme } from '@material-ui/core/styles';
import { red, gray } from '@material-ui/core/colors';

// Create a theme instance.
const theme = createMuiTheme({
  palette: {
    primary: {
      main: '#673ab7'
    },
    secondary: {
      main: '#f50057'
    },
    error: {
      main: red.A400
    },
    background: {
      default: gray.A400
    }
  }
});

export default theme;
